import React from 'react';
import './App.css';

const SearchItem = ({props}) => {
    console.log(props)
    return (
        <div>
            <h1>{props.groupDisplay}</h1>
            <h2>{props.item.displayName}</h2>
        </div>
    )
}

export default SearchItem;
